Data Scientist 
Permanent opportunity | Brisbane CBD based 
  Deliver analytics using advanced techniques - machine learning and AI 
  Unique opportunity within enterprise market-leader 

  About the Role
  Working for this major enterprise organisation, you will join a core Data Science team working with the latest and greatest technologies. You will be tasked with delivering descriptive, predictive and prescriptive analytics using techniques such as advanced analytics, machine learning, optimisation and AI.
  This is a unique opportunity to join a market leading and iconic Australian brand. With your technical skills, you will bring energy and passion to a high-performing analytics team.
  The focus on your analysis will be to provide a capability to make smarter decisions, deliver better products and services, and improved customer experience (Cx).
  Key Accountabilities
  Engage with the business to identify complex data-led problems which need to be solved, conducting analysis, discovering root causes and providing actionable insights for decision makers;
    Design and develop Machine Learning and AI Systems to drive business value and customer experience;
    Identify opportunities for activities which achieve revenue growth;
    Contribute to the development of customer solutions;
    Contribute to the formulation of strategic business plans;
    Proactively provide insights to improve products, channels, customer experience; and
    Undertake detailed analysis to provide insight to business performance.
  Core Capabilities
  Ability to design, build & maintain Machine Learning and AI Systems;
    Ability to work with Terabytes scale data sets - structured and unstructured;
    Ability to solve complex, challenging and uncertain problems using superior analytical skills;
    Ability to understand business processes and identify improvement opportunities; and
    Ability to drive innovation and change.
  Skills and Experience
  Ideally, you will possess a Bachelor or Master’s Degree in quantitative field or equivalent;
    Experience in a Data-Science focussed role and a proven building and implementing Machine Learning or AI Systems;
    Deep understanding of SQL, Python, R, Scala;
    Experience with Data Science Platforms (eg Databrics, AWS Sagemaker, R-Studio, Jupyter Notebooks);
    Experience with AWS technologies is essential;
    Strong Database experience (eg Teradata, MS SQL, AWS Redshift);
    DevOps tasks like Git, CI/CD, Docker, Kubernetes; and
    API consumption and development.
  For more information please call Lewis Westerman at u&u on 07 3232 9147, quoting reference number 17236. Alternatively, to submit an application, please click below.
  Please submit your resume in Word format only.




